import { CREATE_ACCOUNT, LOG_IN } from '../actions/types';

const initialState = {
    status : []
}

export default function(state = initialState, action) {
    switch (action.type) {
        case CREATE_ACCOUNT:
            console.log('reducer')
            return {
                ...state,
                status: action.payload
            };
        case LOG_IN:
            
        default:
            return state;
    }
}
